import React from "react";
import SquareList from './SquareList'
import Greeting from './Greeting'

function Projects() {
  return (
    <>
      <div className="page-container">
        <div className="container">
          <h2> <Greeting /> </h2>
          <p>
          Programming is a universe itself yet to discover... Here, I am tracking my growth as a developer and show some of the projects I have developed. <br />
          Eventually I will write down how and why I solved coding problems, and reveal hurdles in my workflow.  
            </p>
          <SquareList />
        </div>
      </div>
    </>
  );
}

export default Projects;
